import React, { useMemo } from 'react';
import { TAX, TAX_COLUMN } from '../../assets/Json/TAX';
import { TableC } from '../../components/TableC/TableC';

const Tax = () => {
  const columns = useMemo(() => TAX_COLUMN, []);
  const data = useMemo(() => TAX, []);
  return (
    <TableC
      columns={columns}
      searchTitle='Distributor'
      searchPlaceHolder='Search Distributor'
      dropdownList={['Transition Value', 'Per-Unit']}
      data={data}
      heading="Distributor's List"
    />
  );
};

export default Tax;
